CREATE TABLE IF NOT EXISTS makanan (
  id INTEGER NOT NULL PRIMARY KEY,
  kalori FLOAT,
  protein FLOAT,
  nama VARCHAR(255),
  kategori VARCHAR(50),
  cluster INTEGER
);

-- Buat sequence
CREATE SEQUENCE makanan_id_seq START 1;

-- Set kolom id untuk gunakan sequence ini
ALTER TABLE makanan ALTER COLUMN id SET DEFAULT nextval('makanan_id_seq');

-- Sinkronkan sequence dengan ID terbesar yang ada
SELECT setval('makanan_id_seq', (SELECT MAX(id) FROM makanan));
